webpackJsonp([0x992cc5e72858],{4943:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Google Patriotism",date:"03 Oct 2006",slug:"/2006-10-03-google-patriotism/",tags:"Y2006"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2006/10/google_reunification_logo.gif" alt="Google Reunification Logo" /></p>\n<p>The German version of Google at google.de has a nice German flag logo to celebrate the <a href="http://en.wikipedia.org/wiki/German_Unity_Day">Day of German Unity holiday</a> today (as pointed out by <a href="http://www.sichelputzer.de/2006/10/03/das-patriotische-google/">Telagon Sichelputzer</a>). However, if you have English set as your language, you see only the normal Google Deutschland logo.</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2006/10/google_deutschland.jpg" alt="Google Deutschland" /></p>\n<ul>\n<li><a href="http://www.google.de/de">google.de in German</a></li>\n<li><a href="http://www.google.de/en">google.de in English</a></li>\n</ul>\n<p>The main site google.com doesn\'t show a special logo in either language.</p>\n<p>Strange. Is this a mistake, or does Google Deutschland think celebrating German reunification is only for German speakers?</p>'},next:{fields:{title:"Hans, Are We the Baddies?",date:"02 Oct 2006",slug:"/2006-10-02-hans-are-we-the-baddies/"}},previous:{fields:{title:"Comeback",date:"08 Oct 2006",slug:"/2006-10-08-comeback/"}}},{node:{fields:{title:"Hans, Are We the Baddies?",date:"02 Oct 2006",slug:"/2006-10-02-hans-are-we-the-baddies/",tags:"Y2006"},html:'<p>The British have always had a somewhat disturbing obsession with Nazis, but the comedy sketch <a href="http://www.youtube.com/watch?v=SO5WoLnOOlU">The Anxious Nazis</a> from <a href="http://en.wikipedia.org/wiki/That_Mitchell_and_Webb_Look">That Mitchell and Webb Look</a> is perhaps a sign they are getting over it (translation: it\'s both poignant and funny as hell). You don\'t suppose they\'re really talking about the war on terror, do you? (via <a href="http://www.spreeblick.com/2006/10/02/sind-wir-etwa-die-bosen/">Spreeblick</a>)</p>\n<p><object width="425" height="350"><param name="movie" value="http://www.youtube.com/v/SO5WoLnOOlU" /><param name="wmode" value="transparent" /><embed src="http://www.youtube.com/v/SO5WoLnOOlU" type="application/x-shockwave-flash" wmode="transparent" width="425" height="350" /></object></p>'},next:{fields:{title:"Don't Get Pregnant in Europe",date:"01 Oct 2006",slug:"/2006-10-01-dont-get-pregnant-in-europe/"}},previous:{fields:{title:"Google Patriotism",date:"03 Oct 2006",slug:"/2006-10-03-google-patriotism/"}}},{node:{fields:{title:"Don't Get Pregnant in Europe",date:"01 Oct 2006",slug:"/2006-10-01-dont-get-pregnant-in-europe/",tags:"Y2006"},html:"<p>Raskal Trippin wants a logo to warn expat women <a href=\"http://raskal.typepad.com/raskal_trippin/2006/10/dont_get_pregna.html\">Don't Get Pregnant in Europe</a>. She's had to defend herself for not drinking, avoiding coffee, simply being American, and then there's the insensitive receptionists:</p>\n<blockquote><p>\n  (We need) an image that effectively communicates to OB/GYN receptionists that the correct response to \"I've had a positive pregnancy test and would like to schedule appointment as soon as possible\" is not \"Do you plan to keep it?\" (And people wonder why folks don't have kids in Germany?)</p>\n<p>  A Don't Get Pregnant in Europe logo - It's just a pain having to explain the differences on both sides of the ocean. Even if it costs 5 euros compared to the 5000 euros it would cost back home, don't do it.\n</p></blockquote>"},next:{fields:{title:"Microwave Chocolate-Chip Pancakes and Sausage on a Stick",date:"30 Sep 2006",slug:"/2006-09-30-microwave-chocolate-chip-pancakes-and-sausage-on-a-stick/"}},previous:{fields:{title:"Hans, Are We the Baddies?",date:"02 Oct 2006",slug:"/2006-10-02-hans-are-we-the-baddies/"}}}],pathPrefix:"",first:!1,last:!1,index:186,pageCount:1101}}}});
